import { takeLatest, call, put } from 'redux-saga/effects';

import { fetchGallerySuccess, fetchGalleryFailure } from './gallery.actions';

import GalleryActionTypes from './gallery.types';

const getMediaList = () => {
	const mediaUrl = 'https://graph.facebook.com/v3.2/17841406842055532/media?access_token=EAAG1aNNIuRQBAHpiFePMeH6vqIZAmXkCbH4aG5ykgz8trTBYYoYwWhZAi1EmhP9NrA6IpF0B95dACF0HLq6RQRRkdl66j5ldWG49A8snSZAvyZAWOJHobxZB423WpVaZAdaCacas8ORNRDRo3ZCogAm7SxADI3JY0NS125kOPpmOAZDZD'
	return fetch(mediaUrl).then(res => res.json())
		.then(list => list)
		.catch(err => err)
}

export function* fetchGalleryAsync() {
	try {
		const mediaList = yield getMediaList();
		console.log(mediaList)
	} catch (err) {
		yield put(fetchGalleryFailure(err.message))
	}
}

export function* fetchGalleryStart() {
	yield takeLatest(
		GalleryActionTypes.FETCH_GALLERY_START, 
		fetchGalleryAsync
	)
}
